import React from "react";
import axios from 'axios';
// reactstrap components


// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import SearchPageHeader from "components/Headers/SearchPageHeader.js";
import DefaultFooter from "components/Footers/DefaultFooter.js";
import Suggest from "./Suggest";

function SearchPage() {
  axios.get('http://api.visitkorea.or.kr/openapi/service/rest/DataLabService/metcoRegnVisitrDDList?ServiceKey=ServiceKey&numOfRows=10&pageNo=1&MobileOS=ETC&MobileApp=TestApp&_type=json')
  .then((Response)=>{console.log(Response.data.tarTursmRqmtList)})
  .catch((Error)=>{console.log(Error)})
  React.useEffect(() => {
    document.body.classList.add("search-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    window.scrollTo(0, 0);
    document.body.scrollTop = 0;
    return function cleanup() {
      document.body.classList.remove("search-page");
      document.body.classList.remove("sidebar-collapse");
    };
  });
  return (
    <>
      <ExamplesNavbar />
      <div className="wrapper">
        <SearchPageHeader />
        <div className="main">
          <Suggest />
        </div>
        <DefaultFooter />
      </div>
    </>
  );
}

export default SearchPage;
